    dst_p[1] |= pack_left_shift_u8(src_p->voltage_0, 0u, 0xffu);
    dst_p[2] |= pack_left_shift_u8(src_p->voltage_1, 0u, 0xffu);
    dst_p[3] |= pack_left_shift_u8(src_p->voltage_2, 0u, 0xffu);

    return (32);
